import axios from 'axios'

const url="http://localhost:8082/DLitheBootcampBasicPOC/rest"

// axios.method(url,object)

const append=async(obj)=>{
    alert(obj+" has received in axios")
    const ack = await axios.post(`${url}/new`,obj)
    
    return ack
}

export {append}
